const textInfor=[
    {text1:"we provide"},
    {text2:"visual coding"},
    {text3:"solution"},
    {text4:"for you webs"}
]
function Info({text1,text2,text3,text4}){
    return(
        <div className="main__inner">
            <div>{text1}</div>
            <div>{text2}</div>
            <div>{text3}</div>
            <div>{text4}</div>
        </div>
    );
}

function MainCont() {
  return (
    <section className="main__cont">
        <Info 
            text1={textInfor.text1}
            text2={textInfor.text2}
            text3={textInfor.text3}
            text4={textInfor.text4}
        />
    </section>
  )
}

export default MainCont
